import React, { Component } from 'react'
import styled  from 'styled-components'
import Header from './Header'

const Container= styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
`
  class Resume extends Component {
    render() {
      return (
        <Container>
          <Header />
        </Container>
      )
    }
  }

export default Resume
